import React from "react";
import { useState } from "react";
import Cards from "./Cards";
import "./App.css";

const App = () => {
   const [name, setName] = useState('urvi');
   return (
      <div>
      {name} has email id of rahul@tutorialspoint.com
      <div>
         <Cards name={name} change={setName} />
      </div>
      </div>
   );
};
